import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {AuthContextProvider} from "./context/AuthContext.js";

ReactDOM.render(
  <React.StrictMode>
   <AuthContextProvider>  
     <App />
   </AuthContextProvider>  
  </React.StrictMode>,
  document.getElementById('root')
);
